import React from "react";
import { Nav, NavbarContainer, NavLogo, NavIcon } from "./NavbarElement";
export const Navbar = () => {
  return (
    <Nav>
      <NavbarContainer>
        <NavLogo to="./">
          <NavIcon />
        </NavLogo>
      </NavbarContainer>
    </Nav>
  );
};
export default Navbar;
